export class User {
    public userID: number;
    public name: string;
    public email: string;
    public profilePicture?: string;

    constructor(name: string, email: string, userID: number, profilePicture?: string) {
        this.userID = userID;
        this.name = name;
        this.email = email;
        this.profilePicture = profilePicture;
    }
}
